import numpy as np
import pandas as pd
from sklearn.preprocessing import MinMaxScaler
from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import LSTM, Dense
from sklearn.metrics import mean_squared_error
import matplotlib.pyplot as plt

# Define a list of items to forecast
items_to_forecast = ['Beans', 'Beans (dry)', 'Bread', 'Maize', 'Maize (white)', 'Milk (cow, pasteurized)', 'Potatoes (Irish)', 'Sorghum']

# Define the sequence length for LSTM
sequence_length = 10

# Define the number of epochs and batch size for training
epochs = 50
batch_size = 32

# Function to create sequences of data
def create_sequences(data, seq_length):
    sequences = []
    for i in range(len(data) - seq_length):
        X = data[i:i+seq_length]
        y = data[i+seq_length]
        sequences.append((X, y))
    return sequences

# Function to build and train an LSTM model for an item
def build_and_train_lstm_model(item_name, data):
    # Select data for the specific item
    item_data = data[data['commodity'] == item_name]['price'].values

    # Normalize the data to the range [0, 1]
    scaler = MinMaxScaler()
    item_data = scaler.fit_transform(item_data.reshape(-1, 1))

    # Split data into training and test sets
    train_size = int(len(item_data) * 0.8)
    train_data, test_data = item_data[:train_size], item_data[train_size:]

    # Create sequences for training and testing data
    train_sequences = create_sequences(train_data, sequence_length)
    test_sequences = create_sequences(test_data, sequence_length)

    # Convert sequences to NumPy arrays
    X_train, y_train = np.array([seq[0] for seq in train_sequences]), np.array([seq[1] for seq in train_sequences])
    X_test, y_test = np.array([seq[0] for seq in test_sequences]), np.array([seq[1] for seq in test_sequences])

    # Build the LSTM model
    model = Sequential()
    model.add(LSTM(50, input_shape=(sequence_length, 1)))
    model.add(Dense(1))
    model.compile(loss='mean_squared_error', optimizer='adam')

    # Train the model
    model.fit(X_train, y_train, epochs=epochs, batch_size=batch_size, verbose=0)

    # Predict on the test set
    y_pred = model.predict(X_test)

    # Inverse transform the predictions to the original scale
    y_test = scaler.inverse_transform(y_test)
    y_pred = scaler.inverse_transform(y_pred)

    # Calculate RMSE (Root Mean Squared Error) as a performance metric
    rmse = np.sqrt(mean_squared_error(y_test, y_pred))
    print(f"{item_name} RMSE: {rmse}")

    # Visualize the results (if desired)
    plt.figure(figsize=(12, 6))
    plt.plot(y_test, label='Actual Prices')
    plt.plot(y_pred, label='Predicted Prices')
    plt.legend()
    plt.title(f"{item_name} Price Forecast")
    plt.xlabel("Time")
    plt.ylabel("Price")
    plt.show()

    # Return the trained model and scaler
    return model, scaler

# Build and train LSTM models for each item
trained_models = {}
for item in items_to_forecast:
    print(f"Training model for {item}...")
    model, scaler = build_and_train_lstm_model(item, merged_df)
    trained_models[item] = (model, scaler)

